'''Goraks''' are typeless [[melee]]-using monsters encountered during the [[Fairytale II - Cure a Queen]] quest, where they are slain for [[Gorak claws|their claws]] which are an ingredient for the [[Magic essence potion]]. They are found in the [[Gorak Plane]] (fairy ring {{Fairycode|DIR}}) and in the [[God Wars Dungeon]].

As goraks within the [[Gorak Plane]] roll the [[gem drop table]] 100% of the time, it is one of the best monsters to kill for the [[shield left half]] with a drop rate of around 1 in 250 (while wearing a [[ring of wealth]]) while having [[Legends' Quest]] completed.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/843817349027430407|date=12 January 2017|archiveurl=https://archive.is/WBCbY|archivedate=28 May 2020|quote=[Goraks + ring of wealth = 1/250 odds for shield left. True or not?] If you've done Legends' Quest, yes.}} The drop rate is further increased if [[Fairytale II - Cure a Queen]] has been completed.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/819512542754119680|date=12 January 2017|archiveurl=https://archive.is/asWpl|archivedate=28 May 2020|quote=They've got some rather anomalous code in there. At most quest states I think it'd be around 1/250.}} Because of this, it is suggested to bring a [[gem bag]] as they drop uncut gems extremely commonly.

