==Trivia==
*Goraks were formerly assigned for a [[Slayer task]] by [[Duradel]] once players were able to access them during [[Fairytale II - Cure a Queen]]. They were removed from Duradel's task list in [[Update:Slayer Assignment Rework|an update]] on [[10 September]] [[2015]]. Despite this, Goraks are still shown as [[slayer monster]]s when casting [[Monster Examine]] on them.

